function App() {
  return (
    <div ClassName="App">
      <Job salary={90000} position="Senior SDE" compony="Amazon"/>
      <Job salary={12000} position="Junior SDE" compony="Google"/>
      <Job salary={10000} position="Project Manager" compony="Netflix"/>
    </div>
  )

     const Job = (props) => {
    return (
      <div>
        <h1> {props.salary}</h1>
        <h1> {props.position}</h1>
        <h1> {props.compony}</h1>
      </div>

    )
  }

}

export default App;
